<script setup lang="ts">
import type {OrderGist} from "~/models/cart/cartQueries";
import {GetOrdersGist} from "~/services/cart.service";
import {EWalletType} from "~/models/users/userDto";

const utilStore = useUtilStore();
const authStore = useAuthStore();
const accountStore = useAccountStore();

definePageMeta({
  layout: 'profile'
})

const loading = ref(false);
const ordersGist:Ref<OrderGist> = ref({
  pending: 0,
  paid: 0,
  returned: 0,
  canceled: 0
});

onMounted(async ()=>{
  loading.value = true;

  const result = await GetOrdersGist();
  if(result.isSuccess){
    ordersGist.value = result.data ?? {
      pending: 0,
      paid: 0,
      returned: 0,
      canceled: 0
    };
  }

  loading.value = false;
})

</script>